import React from 'react';

const TodoList = (props) => {
    return (
        <>
        <div className='todo_style'>
        <i class="fa-times-circle" aria-hidden="true"/>
        <li>{props.text}</li>
        </div>
        </>
    )
}

export default TodoList;
